import React from 'react';
import ReactDOM from 'react-dom';
import Routes from './routes/Routes';
import { Provider } from 'react-redux';

ReactDOM.render(
  <Provider>
    <React.StrictMode>
      <Routes />
    </React.StrictMode>
  </Provider>,
  document.getElementById('root')
);
